n// remake colors\n//frontend/applications/StyleConfig/src/assets/scss/app.scss\n//@import '../StyleConfig/src/assets/scss/mixins/material';\n//@import 'mixins/fonts';\n\n/// colors\n//@import '../Colors/colors.scss'; ///// no need to use colors, as i am using global vars/ tokens !!!!!!!!!!\n//@import  '../FontsTypography/foundation-fonts-weights.scss'; //// put in global\n//// colors\n/// these are from ---- bades ... should i make colors for this or add\n\n\n\n/// better name\n//// flex is not adding padding\n//correct divs\n.badge-basic {\n    cursor: pointer;\n    width: fit-content;\n    height: 18px;\n    //flex-grow: 0;\n    display: flex;\n    flex-direction: row;\n    justify-content: flex-start;\n    align-items: center;\n    gap: 4px;\n    padding: 3px 4px;\n    background-color: var(--color-greyscale-grey-50);\n    color: var(--text-white-100);\n\n    .badge-message {\n       // width: 36px; looses a few pixel - so maybe font is not correct\n       // height: 12px;\n        flex-grow: 0;\n        font-family: breuercondensed;\n        //font-size: $font-size-14; //// needs to be a globa\n        font-size: 12px;\n        font-weight: 500;\n        //font-stretch: condensed; from main text\n        line-height: 13px;\n        letter-spacing: 0.24px;\n        text-align: center;\n    }\n\n    @media (min-width: 768px) {\n\n        height: 20px;\n\n        .badge-message {\n            height: 14px;\n            font-size: 14px;\n            line-height: 14px;\n            letter-spacing: 0.28px;\n        }\n    }\n}\n\n//name-basic: its a must\n// Emphasis : Heavy, Medium, Large () dark, medium, light\n// Variant - alert info, alert-success\n// Icon: lable or label + icon\n\n/// variant\n/// Totallt new\n.badge-icon {\n    @extend .badge-basic;\n   // width: 67px;\n   /* width: fit-content;\n    //width: fit-content;\n    height: 20px;\n    flex-grow: 0;\n    display: flex;\n    flex-direction: row;\n    justify-content: flex-start;\n    align-items: center;\n    gap: 4px;\n    padding: 3px 4px;\n   //background-color: var(--alert-success-default);\n    background: var(--greyscale-grey-50); /// use tokens or vars?\n*/\n    .material-symbols-outlined {\n        font-size: 12px;\n        color: var(--text-white-100);\n        margin-left: -1px;\n\n        @media (min-width: 768px) {\n            font-size: 14px;\n        }\n    }\n}\n\n/// netral\n// variant (eg neutral) + Emphasis (eg. heavy, medium, light\n// should i name variant-neutral-emphasis-heavy ?? too long\n// current alligo variant-base-large variant-primary-large\n\n// size variants small, medium, large for desktop and mobile\n\n// size vars desktop\n//How to accomidate for SB display and real sys\n// maybe these can be for SB display\n.basic-desktop {\n    // 44\n    // 20\n}\n\n.basic-mobile {\n//\n}\n\n.variant-neutral-default {\n    background: var(--color-greyscale-grey-50);\n    color: var(--text-white-100);\n}\n\n.variant-neutral-medium {\n    background: var(--color-greyscale-grey-20);\n    color: var(--text-highest-emphasis);\n}\n\n.variant-neutral-light {\n    background: var(--color-greyscale-grey-05);\n    color:  var(--text-highest-emphasis);\n    outline: 1px solid var(--color-greyscale-grey-10);\n}\n\n// info\n.variant-info-default {\n    background: var(--info-default);\n    color: var(--text-white-100);\n}\n\n.variant-info-medium {\n    background: var(--info-medium);\n    color: var(--text-highest-emphasis);\n\n    .material-symbols-outlined {\n        color: var(--text-highest-emphasis);\n    }\n}\n\n.variant-info-light {\n    background: var(--info-light);\n    outline: 1px solid var(--info-medium);\n    color:  var(--text-highest-emphasis);\n\n    .material-symbols-outlined {\n        color: var(--text-highest-emphasis);\n    }\n}\n\n// Success\n.variant-success-default {\n    background: var(--success-default);\n    color: var(--text-white-100);\n}\n\n.variant-success-medium {\n    background: var(--success-medium);\n    color: var(--